import React, {useState} from 'react';
import classes from '../../CSS/Main.module.css'
import Logo from '../../Assets/Navbar/Logo.png'
import Progress from './LoadingElem';

const Navbar = props => {

    const [loadState, setloadState] = useState({
        loadprog: 0,
    });
    const LoadPage = () =>{
        setloadState({
            loadprog: 70
        })
    }
    const LoadPage2 = () =>{
        setloadState({
            loadprog: 100
        })

    }
    const LoadPage3 = () =>{
        setloadState({
            loadprog: 101
    })
}

    return(
       <main className={classes.Navbar}>
            <nav className={classes.NavbarBody}>
                <span><img className={classes.Logo} src={Logo} alt="Logo"></img></span>
                <ul className={classes.NavButtons}>
                    <li className={classes.NavButton}>
                            <span onClick={LoadPage}>PLAY</span></li>
                    <li className={classes.NavButton}>
                        <span onClick={LoadPage}>RANKINGS</span></li>
                </ul>
                <ul className={classes.NavButtonLogin}>
                    <li className={classes.NavButton}>
                            <span onClick={LoadPage}>LOGIN</span></li>
                </ul>
            </nav>
            <Progress complete={loadState.loadprog} loadbar={loadState.loadprog}/>
        </main> 
    )
};
export default Navbar;
